window.bookSummaryJSON = "<p><b>Evelyn's deeds are coming back to haunt her.</b></p> <p>Free to travel among the stars, the former warlord is enjoying her freedom, even if she’s occasionally exasperated by the women who’ve attached themselves to her. They accompany her as she encounters wonders, from dryad terraforming ships to the orcish arenas of Skaloth.</p> <p>Yet Evelyn has enemies, and they have not forgotten her. They target one of the few people she truly cares about, knowing that Evelyn will come. When she does she may be drawn into a trap from which even she can’t escape.</p>"; 
